import axios from "axios"
import { useEffect, useState } from "react"

export function Teamlist() {
    const [teams, setTeams] = useState([]);
    // Etapa para consumir a api
    useEffect(() => {
        axios.get('https://estagio.geopostenergy.com/WorldCup/GetAllTeams',{
            headers: {
                'git-user': 'theoalmeida'
            }
        })
            .then(({data}) => {
                setTeams(data);
            });
            // eslint-disable-next-line react-hooks/exhaustive-deps
    }, [])  
    var lista = []
    for (const pais in teams["Result"]) {
        lista.push(teams["Result"][pais]["Name"])
    };

    // Etapa para sortear os grupos
    var grupoA = [];
    var grupoB = [];
    var grupoC = [];
    var grupoD = [];
    var grupoE = [];
    var grupoF = [];
    var grupoG = [];
    var grupoH = [];

    var x = 0 // variavel de apoio para o sorteio
    while (x < 32) {
        var y = Math.floor(Math.random()*((31-x)- 0 + 1)) + 0  
        if (x <= 3) {
            grupoA.push(lista[y])
            console.log(grupoA, x)
        } else if (x > 3 && x <= 7) {
            grupoB.push(lista[y])
        } else if (x > 7 && x <= 11) {
            grupoC.push(lista[y])
        } else if (x > 11 && x <= 15) {
            grupoD.push(lista[y])
        } else if (x > 15 && x <= 19) {
            grupoE.push(lista[y])
        } else if (x > 19 && x <= 23) {
            grupoF.push(lista[y])
        } else if (x > 20 && x <= 27) {
            grupoG.push(lista[y])
        } else if (x > 27 && x <= 31) {
            grupoH.push(lista[y])
        }
        lista.splice(y, 1)
        x += 1
    }

    // Etapa de sortear os resultados das rodadas da fase de grupo
    // Rodadas grupo A:
    var grupoAtime1r1 = Math.floor(Math.random()*6)
    var grupoAtime1r2 = Math.floor(Math.random()*6)
    var grupoAtime1r3 = Math.floor(Math.random()*6)
    var grupoAtime2r1 = Math.floor(Math.random()*6)
    var grupoAtime2r2 = Math.floor(Math.random()*6)
    var grupoAtime2r3 = Math.floor(Math.random()*6)
    var grupoAtime3r1 = Math.floor(Math.random()*6)
    var grupoAtime3r2 = Math.floor(Math.random()*6)
    var grupoAtime3r3 = Math.floor(Math.random()*6)
    var grupoAtime4r1 = Math.floor(Math.random()*6)
    var grupoAtime4r2 = Math.floor(Math.random()*6)
    var grupoAtime4r3 = Math.floor(Math.random()*6)

    //Rodadas grupo B:
    var grupoBtime1r1 = Math.floor(Math.random()*6)
    var grupoBtime1r2 = Math.floor(Math.random()*6)
    var grupoBtime1r3 = Math.floor(Math.random()*6)
    var grupoBtime2r1 = Math.floor(Math.random()*6)
    var grupoBtime2r2 = Math.floor(Math.random()*6)
    var grupoBtime2r3 = Math.floor(Math.random()*6)
    var grupoBtime3r1 = Math.floor(Math.random()*6)
    var grupoBtime3r2 = Math.floor(Math.random()*6)
    var grupoBtime3r3 = Math.floor(Math.random()*6)
    var grupoBtime4r1 = Math.floor(Math.random()*6)
    var grupoBtime4r2 = Math.floor(Math.random()*6)
    var grupoBtime4r3 = Math.floor(Math.random()*6)

    //Rodadas grupo C:
    var grupoCtime1r1 = Math.floor(Math.random()*6)
    var grupoCtime1r2 = Math.floor(Math.random()*6)
    var grupoCtime1r3 = Math.floor(Math.random()*6)
    var grupoCtime2r1 = Math.floor(Math.random()*6)
    var grupoCtime2r2 = Math.floor(Math.random()*6)
    var grupoCtime2r3 = Math.floor(Math.random()*6)
    var grupoCtime3r1 = Math.floor(Math.random()*6)
    var grupoCtime3r2 = Math.floor(Math.random()*6)
    var grupoCtime3r3 = Math.floor(Math.random()*6)
    var grupoCtime4r1 = Math.floor(Math.random()*6)
    var grupoCtime4r2 = Math.floor(Math.random()*6)
    var grupoCtime4r3 = Math.floor(Math.random()*6)

    return (
        <div>
            <div class="faseDeGrupos">
                <div class="titulo">Grupos sorteados: </div>
                <table class="grupo">
                    <tr>
                        <td>Grupo A :</td>
                        <td><img class="flagPais" src={`../imgs/${grupoA[0]}.png`} />{grupoA[0]}</td>
                        <td><img class="flagPais" src={`../imgs/${grupoA[1]}.png`} />{grupoA[1]} </td>
                        <td><img class="flagPais" src={`../imgs/${grupoA[2]}.png`} />{grupoA[2]} </td>
                        <td><img class="flagPais" src={`../imgs/${grupoA[3]}.png`} />{grupoA[3]} </td>
                    </tr>
                    <tr>
                        <td>Grupo B :</td>
                        <td><img class="flagPais" src={`../imgs/${grupoB[0]}.png`} />{grupoB[0]}</td>
                        <td><img class="flagPais" src={`../imgs/${grupoB[1]}.png`} />{grupoB[1]} </td>
                        <td><img class="flagPais" src={`../imgs/${grupoB[2]}.png`} />{grupoB[2]} </td>
                        <td><img class="flagPais" src={`../imgs/${grupoB[3]}.png`} />{grupoB[3]} </td>
                    </tr>
                    <tr>
                        <td>Grupo C :</td>
                        <td><img class="flagPais" src={`../imgs/${grupoC[0]}.png`} />{grupoC[0]}</td>
